// ** User List Component
import TableWebToGame from "./webToGame/Table";
import TableGameToWeb from "./gameToWeb/Table";
// ** React Imports
import { useState, useEffect } from "react";
import { useParams, Link } from "react-router-dom";

import { useSelector, useDispatch } from "react-redux";

// ** Third Party Components
import { User, Info, Share2 } from "react-feather";
import {
  Card,
  CardBody,
  CardHeader,
  Car,
  Row,
  Col,
  Nav,
  NavItem,
  NavLink,
  TabContent,
  TabPane,
  Alert,
} from "reactstrap";
// ** Styles
import "@Styles/react/apps/app-users.scss";

const UsersList = () => {
  const [activeTab, setActiveTab] = useState("1");
  return (
    <div className="app-user-list">
      <CardHeader>
        <Nav pills>
          <NavItem>
            <NavLink
              active={activeTab === "1"}
              onClick={() => setActiveTab("1")}
            >
              <User size={14} />
              <span className="align-middle d-none d-sm-block">Game To Web</span>
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={activeTab === "2"}
              onClick={() => setActiveTab("2")}
            >
              <Info size={14} />
              <span className="align-middle d-none d-sm-block">Web To Game</span>
            </NavLink>
          </NavItem>
        </Nav>
      </CardHeader>
      <CardBody className="pt-2">
        <TabContent activeTab={activeTab} key={activeTab}>
          <TabPane tabId="1">{activeTab == "1" && <TableGameToWeb />}</TabPane>
          <TabPane tabId="2">{activeTab == "2" && <TableWebToGame />}</TabPane>
        </TabContent>
      </CardBody>
    </div>
  );
};

export default UsersList;
